<script lang="ts" setup>
const props = defineProps({
  index: {
    type: Number,
    default: 1,
    required: true,
  },
  activeNumber: {
    type: Number,
    default: 1,
    required: true,
  },
})

const group = ref()
const identicons = [
  `data:image/svg+xml;base64,`,
  `data:image/svg+xml;base64,`,
  `data:image/svg+xml;base64,`,
  'data:image/svg+xml;base64,',
  'data:image/svg+xml;base64,',
  'data:image/svg+xml;base64,',
  'data:image/svg+xml;base64,',
]

const className = computed(() => {
  switch (props.activeNumber) {
    case 0:
      return '.zero'
    case 1:
      return '.one'
    case 2:
      return '.two'
    case 3:
      return '.three'
    case 4:
      return '.four'
    case 5:
      return '.five'
    case 6:
      return '.six'
    case 7:
      return '.seven'
    case 8:
      return '.eight'
    case 9:
      return '.nine'
    default:
      return '.one'
  }
})

const identiconImages = []
function addIdenticonsToPage() {
  const pathsToAddIdention = group.value.querySelectorAll(className.value)
  pathsToAddIdention.forEach((path) => {
    const identicon = document.createElement('div')
    const sizing = path.getBoundingClientRect()
    identicon.style.top = `${sizing.top + window.scrollY + 0.5}px`
    identicon.style.left = `${sizing.left + 0.5}px`
    identicon.style.height = `${sizing.width - 1}px`
    identicon.style.width = `${sizing.width - 1}px`
    identicon.classList.add('identicon-container')
    identicon.innerHTML = `<img class="identicon imageReveal" src="${
        identicons[Math.floor(Math.random() * 7)]
      }">`
    //   identicon.classList.add('show')
    document.getElementById('clock')?.append(identicon)
    identiconImages.push(identicon)
  })
}

onMounted(() => {
  nextTick(() => {
    setTimeout(() => {
      addIdenticonsToPage()
    }, 1000)
  })
  window.addEventListener('resize', () => {
    identiconImages.forEach((ident) => {
      ident.remove()
    })
    nextTick(() => {
      addIdenticonsToPage()
    })
  })
})

watch(
  () => props.activeNumber,
  () => {
    identiconImages.forEach((ident) => {
      ident.remove()
    })
    nextTick(() => {
      addIdenticonsToPage()
    })
  },
)

const offset = computed(() => {
  switch (props.index) {
    case 0:
      return 0
    case 1:
      return props.index * (156 + 52)
    case 2:
      return (props.index * 156) + 52 + 104
    case 3:
      return (props.index * 156) + (2 * 52) + 104
    case 4:
      return (props.index * 156) + (2 * 52) + 208
    case 5:
      return (props.index * 156) + (3 * 52) + 208
    default: return 0
  }
})
</script>

